      viewBox="0 0 200 200"
    >
      <path
        fill="#08BDBA"
        d="M157 76.7c5.2 20.8-10.3 43.5-30.7 57.9-20.4 14.4-45.6 20.5-62 9.8-16.4-10.8-23.9-38.5-16.5-62.4 7.4-23.8 29.8-43.8 54-44.4 24.1-.6 50 18.3 55.2 39.1z"
      ></path>
    </svg>
  );
  className = 'opacity';
}

export default Blob1;
